// ==UserScript==
// @name         CSDNock
// @namespace    http://tampermonkey.net/
// @version      0.0.5
// @description  BlogNock系列，CSDN文章的标识优化
// @author       Exisi
// @license      MIT License
// @match        blog.csdn.net/*/article/details/*
// @match        *.blog.csdn.net/article/details/*
// @supportURL   https://github.com/Exisi/BlogNock/issues/
// @grant        GM_registerMenuCommand
// @grant        GM_setValue
// @grant        GM_getValue
// ==/UserScript==

(function () {
	"use strict";
	const features = {
		recommend_type_download: {
			enabled: GM_getValue("recommend_type_download", true),
			selector: ".recommend-item-box.type_download.clearfix",
		},
		mark: {
			copyright: {
				enabled: GM_getValue("copyright", true),
				selector: [".article-type-img", ".article-info-box", ".article-source-link a"],
				original:
					"data:image/png;base64,",
				reprint:
					"data:image/png;base64,",
				translate:
					"data:image/png;base64,",
			},
			datetime: {
				enabled: GM_getValue("datetime", true),
				selector: [".time", ".up-time"],
			},
			readtime: {
				enabled: GM_getValue("readtime", true),
				selector: ["#content_views", ".bar-content", ".blog-content-box"],
				icon: "data:image/png;base64,",
			},
		},
		source_redirct: {
			enabled: GM_getValue("source_redirct", true),
			selector: [".article-type-img", ".article-source-link a"],
		},
	};

	const setModal = `<div class="modal-dialog"> <div class="modal-setting" onClick="event.cancelBubble = true"> <div class="modal-header"> <h3>功能设置</h3> <span class="btn-dialog-close">×</span> </div> <div class="modal-body"> <div class="setting-item"> <span>替换文章标识图片（原创/转载/翻译）</span> <span> <input type="checkbox" id="feature-mark-copyright" aria-nock="copyright"/> <label for="feature-mark-copyright"></label> </span> </div> <div class="setting-item"> <span> 文章显示时间优化 </span> <span> <input type="checkbox" id="feature-mark-datetime" aria-nock="datetime" /> <label for="feature-mark-datetime"></label> </span> </div> <div class="setting-item"> <span> 文章阅读时长 </span> <span> <input type="checkbox" id="feature-mark-readtime" aria-nock="readtime"/> <label for="feature-mark-readtime"></label> </span> </div> <div class="setting-item"> <span> 移除底部推荐的 CSDN 下载 </span> <span> <input type="checkbox" id="feature-recommend-type-download" aria-nock="recommend_type_download"/> <label for="feature-recommend-type-download"></label> </span> </div> <div class="setting-item"> <span> 自动转载原链重定向 </span> <span> <input type="checkbox" id="feature-source-redirct" aria-nock="source_redirct"/> <label for="feature-source-redirct"></label> </span> </div> </div> </div> </div>`;
	const setStyle = `@keyframes fall { 0% { transform: translate(0%, -100%); opacity: 0; } 100% { transform: translate(0%, 0%); opacity: 1; } } .setting-item input[type=checkbox] { height: 0; width: 0; display: none; } .setting-item label { cursor: pointer; text-indent: -9999px; width: 40px; height: 20px; background: pink; display: block; border-radius: 100px; position: relative; } .setting-item label:after { content: ''; position: absolute; top: 2px; left: 2px; width: 15px; height: 15px; background: #fff; border-radius: 90px; transition: 0.2s; } .setting-item input:checked+label { background: #57a; } .setting-item input:checked+label:after { left: calc(100% - 2px); transform: translateX(-100%); } .setting-item label:active:after { width: 28px; } .modal-dialog { display:none; border: none; position: fixed; z-index: 9999; left: 0; top: 0; width: 100%; min-width: 100vw; min-height: 100vh; height: 100%; background-color: rgba(0, 0, 0, 0.4); } .modal-setting { width: 450px; margin: auto; background-color: #ffffff; border-radius: 5px; padding: 20px; margin-top: 40px; position: relative; box-sizing: border-box; animation: fall 0.5s ease-in-out; } .modal-header { border-bottom: 1px solid #000000; } .modal-header h3 { padding: 10px 0; margin: 0; } .modal-header span { font-size: 24px; color: #ccc; position: absolute; right: 5px; top: 0; cursor: pointer; } .setting-item { margin: 10px 0; display: flex; justify-content: space-between; }`;

	const dStyle = document.createElement("style");
	dStyle.innerHTML = setStyle;
	document.head.appendChild(dStyle);
	document.body.innerHTML += setModal;

	const checkboxList = document.querySelectorAll(".setting-item input");
	Array.from(checkboxList).forEach((checkbox) => {
		const nock = checkbox.getAttribute("aria-nock");
		checkbox.checked = GM_getValue(nock, true);
	});

	const showSetting = () => (document.querySelector(".modal-dialog").style.display = "block");
	const closeSetting = () => (document.querySelector(".modal-dialog").style.display = "none");

	document.querySelector(".modal-dialog").addEventListener("click", closeSetting);
	document.querySelector(".btn-dialog-close").addEventListener("click", closeSetting);
	document.querySelector(".modal-body").addEventListener("click", (e) => {
		if (e.target.type !== "checkbox") {
			return;
		}
		const nock = e.target.getAttribute("aria-nock");
		const flag = GM_getValue(nock) == null ? false : !GM_getValue(nock);
		GM_setValue(nock, flag);
	});
	GM_registerMenuCommand("功能设置", showSetting);

	if (features.recommend_type_download.enabled) {
		const downloadItemList = document.querySelectorAll(features.recommend_type_download.selector);
		Array.from(downloadItemList)
			.filter((item) => {
				const link = item.querySelector("a")?.href;
				return link && link.includes("download.csdn");
			})
			.forEach((item) => (item.style.display = "none"));
	}

	if (features.mark.copyright.enabled) {
		const copyright = document.querySelector(features.mark.copyright.selector[0]);
		const infoBox = document.querySelector(features.mark.copyright.selector[1]);
		const sourceUrl = document.querySelector(features.mark.copyright.selector[2]);
		copyright.style.visibility = "hidden";

		const iconUrl = copyright.getAttribute("src");
		const type = iconUrl.substring(iconUrl.lastIndexOf("/") + 1, iconUrl.lastIndexOf("."));
		infoBox.innerHTML += `<a href=${sourceUrl}>
								<img src=${features.mark.copyright[type]} alt="${type}"
								style="width:43px; height:43px; position:absolute; top:7px; left:2px"/>
							 </a>`;
	}

	if (features.mark.datetime.enabled) {
		const postTime = document.querySelector(features.mark.datetime.selector[0]);
		const updateTime = document.querySelector(features.mark.datetime.selector[1]);

		const regex = /\d{4}-\d{1,2}-\d{1,2} \d{1,2}:\d{1,2}:\d{1,2}/g;
		let rawPostTime = postTime.innerText.match(regex)[0];
		let rawUpdateTime = updateTime.innerText.match(regex)[0];

		[rawPostTime, rawUpdateTime] = [rawPostTime, rawUpdateTime].sort(
			(a, b) => new Date(a) - new Date(b)
		);

		const postTimeAgo = calculateTimeAgo(rawPostTime);
		const updateTimeAgo = calculateTimeAgo(rawUpdateTime);

		postTime.style.cursor = "pointer";
		postTime.style.fontSize = "14px";
		postTime.style.textDecoration = "underline";
		postTime.innerText = `${rawPostTime}（${postTimeAgo}发布）`;
		postTime.setAttribute("data-time", rawPostTime);
		postTime.addEventListener("click", (e) => {
			const rawTime = e.target.getAttribute("data-time");

			if (rawTime == rawPostTime) {
				e.target.setAttribute("data-time", rawUpdateTime);
				e.target.innerText = `${rawUpdateTime}（${updateTimeAgo}更新）`;
				return;
			}

			e.target.setAttribute("data-time", rawPostTime);
			e.target.innerText = `${rawPostTime}（${postTimeAgo}发布）`;
		});
	}

	if (features.mark.readtime.enabled) {
		const readbox = document.createElement("span");
		readbox.style.display = "flex";
		readbox.style.alignItems = "center";
		const textCount = document.querySelector(features.mark.readtime.selector[0]).innerText.length;
		const readtime = textCount / 400;
		if (readtime >= 1440) {
			const days = Math.floor(readtime / 1440);
			readbox.innerHTML = `<img src=${features.mark.readtime.icon} width='22'><span style='cursor:pointer;'> 预计阅读时长 ${days} 天</span>`;
		}

		if (readtime >= 60) {
			const hours = Math.floor(readtime / 60);
			const minutes = Math.floor(readtime % 60);
			readbox.innerHTML = `<img src=${features.mark.readtime.icon} width='22'><span style='cursor:pointer;'> 预计阅读时长 ${hours} 小时 ${minutes} 分钟</span>`;
		}

		if (readtime >= 1) {
			const minutes = Math.round(readtime);
			readbox.innerHTML = `<img src=${features.mark.readtime.icon} width='22'><span style='cursor:pointer;'> 预计阅读时长 ${minutes} 分钟</span>`;
		}

		if (readtime < 1) {
			const seconds = Math.round(readtime * 60);
			readbox.innerHTML = `<img src=${features.mark.readtime.icon} width='22'><span style='cursor:pointer;'> 预计阅读时长 ${seconds} 秒</span>`;
		}
		readbox.style.textDecoration = "underline";
		readbox.addEventListener("click", () =>
			document.querySelector(features.mark.readtime.selector[2]).scrollIntoView(false)
		);
		document.querySelector(features.mark.readtime.selector[1]).appendChild(readbox);
	}

	if (features.source_redirct.enabled) {
		const copyright = document.querySelector(features.source_redirct.selector[0]);
		const sourceUrl = document.querySelector(features.source_redirct.selector[1]);
		const iconUrl = copyright.getAttribute("src");
		const type = iconUrl.substring(iconUrl.lastIndexOf("/") + 1, iconUrl.lastIndexOf("."));
		if (type === "reprint") {
			window.location.href = sourceUrl;
		}
	}

	function calculateTimeAgo(datetime) {
		const SECOND = 1000;
		const MINUTE = 60 * SECOND;
		const HOUR = 60 * MINUTE;
		const DAY = 24 * HOUR;
		const MONTH = 30 * DAY;
		const YEAR = 12 * MONTH;

		const postDate = new Date(datetime);
		const currentDate = new Date();
		const timeDiff = currentDate - postDate;

		if (timeDiff >= YEAR) {
			return Math.floor(timeDiff / YEAR) + " 年前";
		}
		if (timeDiff >= MONTH) {
			return Math.floor(timeDiff / MONTH) + " 个月前";
		}
		if (timeDiff >= DAY) {
			return Math.floor(timeDiff / DAY) + " 天前";
		}
		if (timeDiff >= HOUR) {
			return Math.floor(timeDiff / HOUR) + " 小时前";
		}
		if (timeDiff >= MINUTE) {
			return Math.floor(timeDiff / MINUTE) + " 分钟前";
		}
		return Math.floor(timeDiff / SECOND) + " 秒前";
	}
})();
